import { FunctionComponent, useState } from "react";
import PropTypes from "prop-types";

import { IYoutubeEmbed } from "./types/types";
import { VideoContainer, IFrameContainer } from "./styles/styled";

const YoutubeEmbed: FunctionComponent<IYoutubeEmbed> = ({ id, themeState }) => {
  const [clicked, setClicked] = useState<boolean>(false);

  return (
    <VideoContainer themeState={themeState} clicked={clicked}>
      <IFrameContainer
        src={`https://www.youtube.com/embed/${id}?autoplay=1`}
        frameBorder="0"
        allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
        allowFullScreen
        title="Embedded youtube"
        onMouseOver={() => setClicked(true)}
        onMouseOut={() => setClicked(false)}
      />
    </VideoContainer>
  );
};

YoutubeEmbed.propTypes = {
  id: PropTypes.string.isRequired,
};

export default YoutubeEmbed;
